import React, { useState, Component } from "react";
import image from "./images/zidane.jpg"

class App extends Component {



    render() {
        return (
        <div className="App">
            <h1>Hello</h1>
            <canvas id="canvas-img" width="640" height="640">
                <img src={image} alt="" />
            </canvas>
        </div>
        )
    }
}

export default App;
